import React from "react";
import style from "./Home.module.css";
import Banner from "./Banner";
import Cards from "./Cards";
import Navbar from "./shared/Navbar";
import Search from "./Search";
import Logos from "./Logos";
const Home = () => {
  return (
    <div >
            <Navbar />

        <div>
        <Banner />
      <Cards />
      <Search />
      <Logos />
        </div>
      
    </div>
  );
};

export default Home;
